import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

export default function Home() {
  return (
    <Router>
      <div className="page-wrap">
        <h4>Homepage</h4>
        <p>This is default homepage... <Link to="/account">Login</Link> <Redirect to="/account" /> to see dashboard</p>
      </div>
    </Router>
  )
}
